import React, { Component } from 'react';
import { Route,HashRouter as Router,Link,Switch} from 'react-router-dom';
import styled from 'styled-components';



const Dropbtn = styled.button`
    font-size: 16px;  
    border: none;
    outline: none;
    color: black;
    padding: 14px 16px;
    background-color: #ffffff;
    font-family: inherit;
    margin: 0;
`;

const Header = styled.div`
  overflow: hidden;
  background-color: #ffffff;
  padding: 15px;
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  & a{
    float: right;
    font-size: 16px;
    color: black;
    text-align: center;
    padding: 14px 16px;
    text-decoration: none;
    
  }
  & a:hover{
    background-color: #ddd;
    display:block;
    text-decoration: none;
  
  }
  // &:hover ${Dropbtn} {
  //   background-color: #ddd;
  // }


`;
const Dropdown_Content = styled.div`
  display: none;
  position: absolute;
  background-color: #f9f9f9;
  min-width: 160px;
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  z-index: 1;

  & a{
    float: none;
    color: black;
    padding: 12px 16px;
    text-decoration: none;
    display: block;
    text-align: left;
    cursor:pointer;
  }
`;

const Dropdown = styled.div`
    float: right;
    overflow: hidden;
    &:hover ${Dropdown_Content} {
      display: block;
      text-decoration: none;
    
    & a:hover{
      background-color: #ddd;
    }

`;

const Content = styled.div`
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  padding : 10px;
  margin : 10px;
`;



class Dashboard extends Component {
  
  constructor(props) {
   
    super(props);
    this.state = {
        company_id:''
    }

    this.logout=this.logout.bind(this);
  }
  logout(){
    sessionStorage.removeItem('formData');
    localStorage.removeItem('formData');
    this.props.history.push("/");
  }

  render() {
   
    const sessionData = localStorage.getItem('formData');
    const Data =  sessionStorage.getItem('formData.data.data.msgcode');
    
    const AllFormData = JSON.parse(sessionData);

    return (
     
      <div className="main_dashboard">
      
            
         <Router basename='/'>
           <div>
           <Header>
               
                <Dropdown>
                  <Dropbtn>Profile 
                      <i class="fa fa-caret-down"></i>
                  </Dropbtn>
                  <Dropdown_Content>
                    <a href="#">Link 1</a>
                    <a onClick={this.logout}>Logout</a>
                    
                  </Dropdown_Content>
                </Dropdown> 
                <a href="#home">Home</a>
               
            </Header>

            <Content>

            </Content>


           </div> 
         </Router>
        </div>  
        

     
    );
  }
 
}
 
export default Dashboard;
